import React, { useEffect } from "react";
import { BrowserRouter, Route, Switch, useLocation } from "react-router-dom";
import Welcome from "./Pages/Welcome";
import ContestPage from "./Pages/ContestSelectorPage";
import { isLoggedIn } from "./APICalls/LoginHandler";
import SpecificContestPage from "./Pages/SpecificContestPage";

const Routes = (props) => {
  /*
  const location = useLocation();

  function callback(loginstatus) {
    console.log("call back has been called");
    //props.setLoginStatus(loginstatus);
  }

  useEffect(() => {
    isLoggedIn(callback);
  }, [location]);*/
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" component={Welcome} />
        <Route path="/contests" component={ContestPage} />
        <Route
          path="/contestpage/:contestCode"
          component={SpecificContestPage}
        />
      </Switch>
    </BrowserRouter>
  );
};

export default Routes;
